INSERT INTO `comments` VALUES (1,1,1,'Bến xe này thật sự ấm cúng và thoải mái. Nhân viên phục vụ rất niềm nở và tận tâm, tôi đã có một trải nghiệm thú vị khi đến đây.'),(2,2,1,'Không thể không khen ngợi sự sắp xếp và hiệu quả tại bến xe này. Các chuyến xe đến đúng giờ và đưa tôi đến nơi một cách nhanh chóng.'),(3,3,1,'Môi trường ở bến xe này sạch sẽ và thoải mái. Tôi thấy an tâm và tự tin khi chờ đợi chuyến xe tại đây.'),(4,4,1,'Đánh giá cao cơ sở vật chất tại bến xe. Có đủ các tiện ích như nhà vệ sinh sạch sẽ và quầy bán hàng để mua đồ ăn nhẹ khi đang chờ xe.'),(5,5,1,'Tôi ấn tượng với sự tổ chức và hệ thống thông tin tại bến xe này. Biển chỉ dẫn rõ ràng giúp tôi dễ dàng tìm đúng tuyến xe mình cần.'),(6,6,1,'Bến xe này có không gian chờ rộng rãi và thoải mái, cung cấp không gian tốt để thư giãn trước khi lên xe.'),(7,7,1,'Điểm mạnh của bến xe này là hệ thống thông tin liên tục cập nhật về lịch trình và tình hình giao thông, giúp tôi dễ dàng theo dõi và điều chỉnh kế hoạch của mình.'),(8,8,1,'Tôi thực sự ấn tượng với tốc độ phục vụ của nhân viên tại quầy bán vé. Họ thân thiện và nhanh chóng giải đáp mọi thắc mắc của tôi.'),(9,9,1,'Bến xe này có sự đa dạng về các tuyến xe, cho phép tôi lựa chọn phù hợp với nhu cầu đi lại của mình.'),(10,10,1,'Một điểm đáng chú ý khác là tại bến xe này, tôi cảm thấy an toàn và yên tâm vì có sự hiện diện của lực lượng bảo vệ và hệ thống giám sát an ninh.'),(11,11,1,'Bến xe này thật sự ấm cúng và thoải mái. Nhân viên phục vụ rất niềm nở và tận tâm, tôi đã có một trải nghiệm thú vị khi đến đây.'),(12,12,1,'Không thể không khen ngợi sự sắp xếp và hiệu quả tại bến xe này. Các chuyến xe đến đúng giờ và đưa tôi đến nơi một cách nhanh chóng.'),(13,13,1,'Môi trường ở bến xe này sạch sẽ và thoải mái. Tôi thấy an tâm và tự tin khi chờ đợi chuyến xe tại đây.'),(14,14,1,'Đánh giá cao cơ sở vật chất tại bến xe. Có đủ các tiện ích như nhà vệ sinh sạch sẽ và quầy bán hàng để mua đồ ăn nhẹ khi đang chờ xe.'),(15,15,1,'Tôi ấn tượng với sự tổ chức và hệ